         <Route  exact path="/area1"  component={ FOOD} />
        <Route  exact path="/area2"  component={ Home} />

        </BrowserRouter>




      //  {  menus.map((menup,index)=>{
      // return   <Menu title={menup.title}  poster={menup.poster} key={index} />
      //  })}
